export function getFlagIcon(flag?: Flag) {
    // if (__DEV__) {
    //     return require('../../assets/flags/' + flag + '.png');
    // }
    if (flag == null) {
        return flagList['XX'];
    }
    if (flagList[flag]) {
        return flagList[flag];
    }
    return flagList['XX'];
}

export function getCountryName(country: Country) {
    return getTranslation(`country.${country.toLowerCase()}` as any);
}
